pragma solidity 0.4.21;

// NOTE: This contract is inspired by the RocketPool Storage Contract,
// found here: https://github.com/rocket-pool/rocketpool/blob/master/contracts/RocketStorage.sol
// And this medium article: https://medium.com/rocket-pool/upgradable-solidity-contract-design-54789205276d

contract Storage {

    // Mappings for Primitive Data Types
    //
    mapping(bytes32 => uint256)    private uIntStorage;
    mapping(bytes32 => string)     private stringStorage;
    mapping(bytes32 => address)    private addressStorage;
    mapping(bytes32 => bytes)      private bytesStorage;
    mapping(bytes32 => bytes32)      private bytes32Storage;
    mapping(bytes32 => bool)       private boolStorage;
    mapping(bytes32 => int256)     private intStorage;

    modifier onlyRegisteredContract() {

        if (boolStorage[keccak256("contract.storage.initialised")] == true) {
            // Make sure the access is permitted to only contracts in our Dapp
            require(addressStorage[keccak256("contract.address", msg.sender)] != 0x0);
        }
        _;
    }

    function Storage() public {

        // Set the main owner upon deployment
        boolStorage[keccak256("access.role", "owner", msg.sender)] = true;
        bytes32Storage[keccak256(1)] = keccak256("access.role", "owner", msg.sender);
    }

    // Methods to Set Data
    function setAddress(bytes32 _key, address _value) external onlyRegisteredContract {
        addressStorage[_key] = _value;
    }

    function setUint(bytes32 _key, uint _value) external onlyRegisteredContract {
        uIntStorage[_key] = _value;
    }

    function setString(bytes32 _key, string _value) external onlyRegisteredContract {
        stringStorage[_key] = _value;
    }

    function setBytes(bytes32 _key, bytes _value) external onlyRegisteredContract {
        bytesStorage[_key] = _value;
    }

    function setBool(bytes32 _key, bool _value) external onlyRegisteredContract {
        boolStorage[_key] = _value;
    }

    function setInt(bytes32 _key, int _value) external onlyRegisteredContract {
        intStorage[_key] = _value;
    }

    // Methods to Delete Data
    //
    function deleteAddress(bytes32 _key) external onlyRegisteredContract {
        delete addressStorage[_key];
    }

    function deleteUint(bytes32 _key) external onlyRegisteredContract {
        delete uIntStorage[_key];
    }

    function deleteString(bytes32 _key) external onlyRegisteredContract {
        delete stringStorage[_key];
    }

    function deleteBytes(bytes32 _key) external onlyRegisteredContract {
        delete bytesStorage[_key];
    }

    function deleteBool(bytes32 _key) external onlyRegisteredContract {
        delete boolStorage[_key];
    }

    function deleteInt(bytes32 _key) external onlyRegisteredContract {
        delete intStorage[_key];
    }

    // Methods to Get Data
    //
    function getAddress(bytes32 _key) external view returns (address) {
        return addressStorage[_key];
    }

    function getUint(bytes32 _key) external view returns (uint) {
        return uIntStorage[_key];
    }

    function getString(bytes32 _key) external view returns (string) {
        return stringStorage[_key];
    }

    function getBytes(bytes32 _key) external view returns (bytes) {
        return bytesStorage[_key];
    }

    function getBytes32(bytes32 _key) external view returns (bytes32) {
        return bytes32Storage[_key];
    }

    function getBool(bytes32 _key) external view returns (bool) {
        return boolStorage[_key];
    }

    function getInt(bytes32 _key) external view returns (int) {
        return intStorage[_key];
    }

}
